var di=this.getObjectByName ("Body1");

var di_pos=[new THREE.Vector3(270,0,0), //1
		   new THREE.Vector3(0,0,270),
		   new THREE.Vector3(180,0,0),
		   new THREE.Vector3(0,0,0), // 4
		   new THREE.Vector3(0,0,90),
		   new THREE.Vector3(90,0,0)
		  ];
var ro=new THREE.Vector3(5,5,5);
var di_n  = Math.floor(Math.random() * 6);


di.geometry.translate(-1.5, -1.5, 1.5);


function update( event ) 
{


	di.rotation.x += ro.x*Math.PI/180;
	//di.rotation.x = di.rotation.x + rp.x;
	di.rotation.y += ro.y*Math.PI/180;
	di.rotation.z += ro.z*Math.PI/180;

	if(di.rotation.x>=360*Math.PI/180) di.rotation.x=0;
	if(di.rotation.y>=360*Math.PI/180) di.rotation.y=0;
	if(di.rotation.z>=360*Math.PI/180) di.rotation.z=0;
	//if(parseInt(di.rotation.x/Math.PI*180/5)==parseInt(di_pos[di_n].x/5)) {
	if(di.rotation.x/Math.PI*180>di_pos[di_n].x -5 && di.rotation.x/Math.PI*180<di_pos[di_n].x + 5) {
		ro.x -= 2;
		if (ro.x < 0) ro.x = 0;
	}
	//if(parseInt(di.rotation.y/Math.PI*180/5)==parseInt(di_pos[di_n].y/5)) 
	if(di.rotation.y/Math.PI*180>di_pos[di_n].y -5 && di.rotation.y/Math.PI*180<di_pos[di_n].y + 5)
	{
		ro.y -= 2;
		if (ro.y < 0) ro.y = 0;
	}
	//if(parseInt(di.rotation.z/Math.PI*180/5)==parseInt(di_pos[di_n].z/5))
	if(di.rotation.z/Math.PI*180>di_pos[di_n].z -5 && di.rotation.z/Math.PI*180<di_pos[di_n].z + 5)
	{
		ro.z -= 2;
		if (ro.z < 0) ro.z = 0;
	}
}
